eval("module.exports = JSON.parse('{\"en\":{\"main_title\":\"Florence Baptistery\",\"title\":\"Florence Baptistery\",\"years\":\"1059-1128\",\"text1\":\"Its origins are unknown although it is believed that it was built over the ruins of a Roman temple dedicated to Mars dating back to the 4th-5th century A.D. It was first described in 897 as a minor basilica. In 1128, it was consacrated as the Baptistery of Florence and as such is the oldest religious monument in Florence.\",\"text2\":\"Its interior deserves a special visit to view the beautiful 13th century mosaics on the inside of the cupola, the spectacular mosaic marble pavement with geometrical patterns and oriental zodiac motifs. There is also the monumental tomb of Baladassare Cossa - Antipope John XXIII - created by Donatello and Michelozzo between 1422 and 1428.\",\"text3\":\"he Baptistery, dedicated to Florence\\'s patron saint, has an octagonal plan and an octagonal lantern with a cupola. Outside it is clad in geometrically patterned colored marble, white Carrara marble and green Prato marble that is typical of Florentine Romanesque architecture.\"},\"ua\":{\"main_title\":\"Флорентійський баптистерій\",\"title\":\"Флорентійський баптистерій\",\"years\":\"1059-1128\",\"text1\":\"Його походження невідоме, хоча вважається, що він був побудований на руїнах римського храму, присвяченого Марсу, датованого 4-5 століттями нашої ери. Вперше він був описаний у 897 році як мала базиліка. У 1128 році він був освячений як флорентійський баптистерій і як такий є найстарішим релігійним пам’ятником у Флоренції.\",\"text2\":\"Його інтер’єр заслуговує на особливу увагу, щоб побачити прекрасні мозаїки 13 століття на внутрішній частині купола, вражаючу мозаїчну мармурову бруківку з геометричними візерунками та мотивами східного зодіаку. Також є монументальна гробниця Баладасаре Косса – антипапа Іоанн XXIII - створений Донателло та Мікелоццо між 1422 та 1428 роками.\",\"text3\":\"Баптистерій, присвячений святому покровителю Флоренції, має восьмикутний план і восьмикутний ліхтар з куполом. Зовні він оздоблений кольоровим мармуром з геометричним малюнком, білим каррарським мармуром і зеленим мармуром Прато, що є типовим для флорентійської романської архітектури.\"},\"es\":{\"main_title\":\"Baptisterio de Florencia\",\"title\":\"Baptisterio de Florencia\",\"years\":\"1059-1128\",\"text1\":\"Su origen es desconocido aunque se cree que fue construida sobre las ruinas de un templo romano dedicado a Marte que data del siglo IV-V d.C. Fue descrita por primera vez en 897 como una basílica menor. En 1128, fue consagrado como el baptisterio de Florencia y, como tal, es el monumento religioso más antiguo de Florencia.\",\"text2\":\"Su interior merece una visita especial para ver los hermosos mosaicos del siglo XIII en el interior de la cúpula, el espectacular pavimento de mosaico de mármol con motivos geométricos y motivos orientales del zodiaco. También está la tumba monumental de Baladassare Cossa - Antipapa Juan XXIII - creado por Donatello y Michelozzo entre 1422 y 1428.\",\"text3\":\"el baptisterio, dedicado al santo patrón de Florencia, tiene planta octogonal y una linterna octogonal con cúpula. El exterior está revestido de mármol de colores con motivos geométricos, mármol blanco de Carrara y mármol verde de Prato, típicos de la arquitectura románica florentina.\"}}');\n\n//# sourceURL=webpack:///./content/architecture/exemple/florence-baptistery.json?");

